import React from 'react';
import '../components/WhyMyriad.css';
import video from '../media/video/video.mp4';
import image from '../media/background images/hero-background.jpg';

const WhyMyriad = () => {
    return (
        <div className="why__container">
            <div className="why__header">Why Myriad</div>
            <div className="why__video">
                <video controls preload="true" playsInline poster={image}>
                    <source src={video} type="video/mp4"/>
                </video>
            </div>
            <div className="why__info"></div>
        </div>
    )
}

export default WhyMyriad
